import TitleComponent from "../components/title.component";
import ContactUsLayout from "../layout/contactUs.layout";

const ContactUsPage = () => (
  <>
    <TitleComponent
      text={{
        title: "Contact us",
        subTitle: "Drop us message and we will get back for you.",
      }}
    />
    <ContactUsLayout />
  </>
);

export default ContactUsPage;
